ense physical activities.\n","#    - Similarly, there’s variability in sleep patterns and weight/BMI, with significant differences across users in terms of daily calorie expenditure, steps, and sleep.\n","\n"]},{"cell_type":"markdown","id":"01225d0b","metadata":{"papermill":{"duration":0.010389,"end_time":"2025-04-29T15:00:39.450689","exception":false,"start_time":"2025-04-29T15:00:39.4403","status":"completed"},"tags":[]},"source":["#########################\n","## Merging Data \n","#########################"]},{"cell_type":"code","execution_count":10,"id":"ea56b31d","metadata":{"execution":{"iopub.execute_input":"2025-04-29T15:00:39.476097Z","iopub.status.busy":"2025-04-29T15:00:39.473622Z","iopub.status.idle":"2025-04-29T15:00:39.491691Z","shell.execute_reply":"2025-04-29T15:00:39.489822Z"},"papermill":{"duration":0.033642,"end_time":"2025-04-29T15:00:39.494348","exception":false,"start_time":"2025-04-29T15:00:39.460706","status":"completed"},"tags":[]},"outputs":[],"source":["# Before visualizing the data, I need to merge some data sets. \n","# I’m going to merge with (outer join) activity and sleep on columns Id and date \n","# (that I previously created after converting Date to date time format)."]},{"cell_type":"code","execution_count":11,"id":"beb9d6c9","metadata":{"execution":{"iopub.execute_input":"2025-04-29T15:00:39.528078Z","iopub.status.busy":"2025-04-29T15:00:39.525347Z","iopub.status.idle":"2025-04-29T15:00:39.586076Z","shell.execute_reply":"2025-04-29T15:00:39.583467Z"},"papermill":{"duration":0.076535,"end_time":"2025-04-29T15:00:39.589036","exception":false,"start_time":"2025-04-29T15:00:39.512501","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 20</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>Id</th><th scope=col>date</th><